const lenis=new Lenis;function raf(e){lenis.raf(e),requestAnimationFrame(raf)}lenis.on("scroll",e=>{console.log(e)}),requestAnimationFrame(raf);const navLinks=document.querySelectorAll(".nav-link");for(const c of navLinks)c.href===window.location.href&&c.classList.add("active");const hamburgerMenu=document.getElementById("hamburger-menu"),bottomNav=document.getElementById("bottom-nav");hamburgerMenu.addEventListener("click",()=>{bottomNav.classList.toggle("open")});